import React, { Component } from "react";
import { Zoom, Bounce } from "react-reveal";
import { Link } from "react-router-dom";
import { Navbar, Nav, NavItem, Container, Row, Col } from "react-bootstrap";
import about from "./images/about.png";
import mission from "./images/mission.png";
import omegaLeo1 from "./images/omegaLeo1.png";

export class Landingpage extends Component {
  render() {
    return (
      <Navbar default collapseOnSelect>
        <Navbar.Header>
          <Navbar.Brand>
            <Link to="/">Codelife</Link>
          </Navbar.Brand>
          <Navbar.Toggle />
        </Navbar.Header>
        <Navbar.Collapse>
          <Nav pullRight>
            <NavItem eventKey={1} componentClass={Link} href="/">
              Home
            </NavItem>
            <NavItem eventKey={2} componentClass={Link} href="/events">
              Events
            </NavItem>
            <NavItem eventKey={3} componentClass={Link} href="/team">
              Team
            </NavItem>
            <NavItem eventKey={3} componentClass={Link} href="/Gallery">
              Gallery
            </NavItem>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default Landingpage;
